/** 

=========================================================
* Vision UI PRO React - v1.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/vision-ui-dashboard-pro-react
* Copyright 2021 Creative Tim (https://www.creative-tim.com/)

* Design and Coded by Simmmple & Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Visionware.

*/
import * as React from 'react';
import { useState, useEffect } from "react";

// react-router components
import { useLocation, Link } from "react-router-dom";

// prop-types is a library for typechecking of props.
import PropTypes from "prop-types";

// @material-ui core components
import Card from "@mui/material/Card";
import Divider from "@mui/material/Divider";
import Tooltip from "@mui/material/Tooltip";
import Backdrop from '@mui/material/Backdrop';
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import IconButton from "@mui/material/IconButton";
import Button from "@mui/material/Button";
import Menu from "@mui/material/Menu";
import Box from '@mui/material/Box';
import Icon from "@mui/material/Icon";
import Grid from "@mui/material/Grid";
import Modal from '@mui/material/Modal';
import Fade from '@mui/material/Fade';

// Vision UI Dashboard PRO React components
import VuiBox from "components/VuiBox";
import VuiTypography from "components/VuiTypography";
import VuiInput from "components/VuiInput";
import VuiButton from "components/VuiButton";

// Vision UI Dashboard PRO React example components
import Breadcrumbs from "examples/Breadcrumbs";
import NotificationItem from "examples/Items/NotificationItem";

import "assets/custom.css";
import { ReactComponent as XLauncherLogo } from "assets/images/logo.svg";

// Custom styles for DashboardNavbar
import {
  navbar,
  navbarContainer,
  navbarRow,
  navbarIconButton,
  navbarDesktopMenu,
  navbarMobileMenu,
} from "examples/Navbars/DashboardNavbar/styles";

// Vision UI Dashboard PRO React context
import {
  useVisionUIController,
  setTransparentNavbar,
  setMiniSidenav,
  setOpenConfigurator,
} from "context";

// Images
import team2 from "assets/images/team-2.jpg";
import logoSpotify from "assets/images/small-logos/logo-spotify.svg";

//Elrond
import { DappProvider, DappUI, logout, useGetAccountInfo } from '@elrondnetwork/dapp-core';

const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  boxShadow: 5,
  bgcolor: '#060b28f0',
  borderRadius: "25px",
  p: 4,
  zIndex: 5
};

function DashboardNavbar({ absolute, light, isMini }) {
  const [navbarType, setNavbarType] = useState();
  const [controller, dispatch] = useVisionUIController();
  const { miniSidenav, transparentNavbar, fixedNavbar, openConfigurator } = controller;
  const [openMenu, setOpenMenu] = useState(false);
  const route = useLocation().pathname.split("/").slice(1);

  //Modal
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  //Elrond login
  const { address, account } = useGetAccountInfo();
  const isLoggedIn = Boolean(address);
  const [timeToConnect, setTimeToConnect] = React.useState(false);

  const { 
    WebWalletLoginButton, 
    WalletConnectLoginButton,
    LedgerLoginButton,
    ExtensionLoginButton
  } = DappUI;

  const [dataAccount, setDataAccount] = useState([]);


  useEffect(() => {
    // Setting the navbar type
    if (fixedNavbar) {
      setNavbarType("sticky");
    } else {
      setNavbarType("static");
    }

    // A function that sets the transparent state of the navbar.
    function handleTransparentNavbar() {
      setTransparentNavbar(dispatch, (fixedNavbar && window.scrollY === 0) || !fixedNavbar);
    }

    /** 
     The event listener that's calling the handleTransparentNavbar function when 
     scrolling the window.
    */
    window.addEventListener("scroll", handleTransparentNavbar);

    // Call the handleTransparentNavbar function to set the state with the initial value.
    handleTransparentNavbar();

    // Remove event listener on cleanup
    return () => window.removeEventListener("scroll", handleTransparentNavbar);
  }, [dispatch, fixedNavbar]);

  const handleMiniSidenav = () => setMiniSidenav(dispatch, !miniSidenav);
  const handleConfiguratorOpen = () => setOpenConfigurator(dispatch, !openConfigurator);
  const handleOpenMenu = (event) => setOpenMenu(event.currentTarget);
  const handleCloseMenu = () => setOpenMenu(false);

  return (   
      <>
        {miniSidenav ? (
          <Grid container spacing={1}> 
            <Grid item xs={12} sm={12} md={6} lg={8}> 

            </Grid>
            <Grid item xs={6} sm={6} md={3} lg={2}>  
              <VuiButton variant="outlined" color="light" size="small"  sx={{ minWidth: 145 }} onClick={handleOpen}>
                <Icon>wallet</Icon>&nbsp;
                Connect
              </VuiButton>
            </Grid>
            <Grid item xs={6} sm={6} md={3} lg={2}>  
              <VuiButton variant="outlined" color="light" size="small" onClick={handleMiniSidenav} sx={{ minWidth: 140}}>
                <Icon>menu</Icon>&nbsp;
                Menu
              </VuiButton>
            </Grid> 
          </Grid> 
        ) : (
          <Grid container>
            <Grid item lg={10}>  

            </Grid>            
            <Grid item lg={2}>              
              <VuiButton 
                variant="outlined" 
                color="light" 
                size="small" 
                sx={{ minWidth: 145}}
                onClick={handleOpen}
              >
                <Icon>wallet</Icon>&nbsp;
                Connect
              </VuiButton>              
            </Grid>        
          </Grid>         
        )}
        <Modal
          aria-labelledby="transition-modal-title"
          aria-describedby="transition-modal-description"
          open={open}
          onClose={handleClose}
          closeAfterTransition
          BackdropComponent={Backdrop}
          BackdropProps={{
            timeout: 500,
          }}
        >
          <Fade in={open}>
            <Box sx={style}>
              <VuiBox sx={{ minHeight: "250px" }} className="farm-card">
                <VuiBox display="flex" mb="12px" alignItems="center">
                  <Tooltip key="logo" title="XLH" placement="bottom">
                    <XLauncherLogo className='xlh-logo2'/>
                  </Tooltip>
                  <VuiBox ml="16px" display="flex" flexDirection="column" lineHeight={0}>
                    <VuiTypography
                      fontSize={16}
                      fontWeight="medium"
                      color="white"
                      textTransform="capitalize"
                      id="transition-modal-title"
                    >
                       Chose a method
                    </VuiTypography>
                  </VuiBox>
                </VuiBox>
                <VuiBox id="transition-modal-description" sx={{ mt: 5 }}>    
                  <Grid container spacing={2}>

                  </Grid>
                </VuiBox>
              </VuiBox>              
            </Box>
          </Fade>
        </Modal>
        <>
            <Box sx={style}>
              <VuiBox sx={{ minHeight: "250px"}} className="farm-card">
                <VuiBox display="flex" mb="12px" alignItems="center" id="transition-modal-title" ml={9}>                                
                  <VuiBox ml="16px" display="flex" flexDirection="column" lineHeight={0}>
                    <VuiTypography
                      fontSize={16}
                      fontWeight="medium"
                      color="white"
                      textTransform="capitalize"
                      alignItems="center"
                    >
                       Chose a method
                    </VuiTypography>
                  </VuiBox>
                </VuiBox>
                <VuiBox id="transition-modal-description" sx={{ mt: 5 }}>    
                  <Grid container spacing={2}>

                  </Grid>
                </VuiBox>
              </VuiBox>              
            </Box>
          </>
      </>



  );
}

export default DashboardNavbar;
